import React ,{ Component} from 'react'
import DenseTable from './components/papers'
import TitleFilterPaper from './components/titleFilter'
import CriterioFitler from './components/criterioFilter'
import Paper from './model/Paper'

const urlPapers ='https://tesisservice.azurewebsites.net/api/Papers/GetPapers';

class app extends React.Component {
  constructor(props) {
    super(props);
    this.state = {papers :[]}; 
  }

  componentDidMount() {
    fetch(urlPapers)
      .then((response) => response.json())
      .then((data) => {
        this.setState({papers : data.list}) 
      });
  }

  render(){
    return (
    <div>
      <CriterioFitler></CriterioFitler>
      <TitleFilterPaper></TitleFilterPaper>    
       <DenseTable dataPapers={this.state.papers}></DenseTable>
    </div>
    )

  }
}



export default app;
